let data = [
    {
    id : 1,
    text : "예상 밖의 일 때문에 속상한 적은 얼마나 있었나?",
    },
    
    {
    id : 2,
    text : "인생에서 중요한 일을 제어할 수 없다고 느낀 경우는 얼마나 있었나?",
    },

    {
    id : 3,
    text : "긴장되고 스트레스를 받았다고 느낀 경우는 얼마나 있었나?",
    },

    {
    id : 4,
    text : "개인적인 문제들을 처리하는 능력에 대해 몇 번이나 확신했는가?",
    },

    {
    id : 5,
    text : "파티나 행사에서 새로운 사람에게 먼저 자신을 소개하기보다는 주로 이미 알고 있는 사람과 대화하는 편이다",
    }
]

export default data;
